import style from './More.module.css' 
export function More() {
    return (
        <div className={style.container}>
            <div className={style.mesage}>
            <h2>Attention</h2>
            <p>This website is designed for practice only and everything here is created by Yeferson Ruzon using reactJS and a Themoviedb API, the design is totally personal inspired by other movie websites.</p>

            </div>
        </div>
    )
}
